import React from 'react';
import Token from './Token';


const Ether = (props) => {
  return (

        <Token 
        url={"./img/dydx.svg"}
        assetName={"Balance"} 
        assetAmount={"11,500.99 DAI"} 
        assetPrice={"Apr"} 
        assetPriceVariation={"6.7%"}
        assetValue={"Earned"} 
        />

      );
}

export default Ether;
